import React from 'react'
import walkSprite from './player_walk.png'
function Player(props) {
    return (
        <div
            style={{
                position: 'relative',
                top: props.position[1],
                left:props.position[0],
                background: `url('${walkSprite})`,
                backgroundPosition: '0 0',
                width: '40px',
                height: '40px',
            }}
        />
    )
}

export default Player
